import rectangle from '../../img/rectangle-7-11.png';
import rectanglePanel from '../../img/rectangle-9.svg';
import polygon3 from '../../img/polygon-3.svg';
import likeButton from '../../img/icon-3.svg';
import checkButton from '../../img/vector-81.svg';

export default function Locations() {
    return (
        <div className="flex flex-col items-start gap-3 relative self-stretch w-full flex-[0_0_auto]">
            <div className="relative self-stretch mt-[-1.00px] [font-family:'Poppins',Helvetica] font-semibold text-[#7a7a7a] text-sm tracking-[0] leading-[15.9px]">
              800sqft with View
            </div>
            <div className="flex flex-col items-center justify-center gap-[13px] relative self-stretch w-full flex-[0_0_auto]">
              <div className="flex flex-col items-start justify-center gap-4 relative self-stretch w-full flex-[0_0_auto]">
                <PropertyListing />
              </div>
              <LoadmoreButton />
            </div>
          </div>
    );
}

function PropertyListing({
    propertyName='Property name', 
    address='(3806 W 20th Ave, Kennewick, WA 99338)',
    suggestedRentValue=1234,
    rent=123,
    floorNumber=10,
    stories=6,
    avgUnitSize='741 SF',
    views=20,
    showings=20,
    date='12.12.2024',
    parking='-',
    type='Apartments - All',
    distance='-'
}) {
    return (
        <div className="relative w-[1013px] h-[186px]">
            <div className="relative h-[186px]">
                <img
                    className="w-[798px] left-[215px] absolute h-[186px] top-0"
                    alt="Rectangle"
                    src={rectanglePanel}
                />
                <div className="absolute w-[184px] h-[111px] top-[58px] left-[806px]">
                    <div className="absolute w-[186px] h-[41px] top-[70px] left-0">
                    <div className="relative w-[184px] h-[41px] rounded-[23.5px] border border-solid border-black">
                        <div className="absolute top-4 left-[13px] [font-family:'Poppins',Helvetica] font-semibold text-black text-xs tracking-[0] leading-[normal] whitespace-nowrap">
                        View Rental Comparisons
                        </div>
                    </div>
                    </div>
                    <div className="absolute w-[131px] h-[47px] top-0 left-[57px]">
                    <div className="absolute h-6 top-0 left-0 [font-family:'Poppins',Helvetica] font-bold text-orange text-xl tracking-[0] leading-[23.7px] whitespace-nowrap">
                        {suggestedRentValue}
                    </div>
                    <div className="absolute h-5 top-[27px] left-0 [font-family:'Poppins',Helvetica] font-normal text-[#918f8f] text-base tracking-[0] leading-[19.2px] whitespace-nowrap">
                        Suggested Rent
                    </div>
                    </div>
                </div>
                <img
                    className="w-[343px] left-0 object-cover absolute h-[186px] top-0"
                    alt="Rectangle"
                    src={rectangle}
                />

                {/* active listing tag */}
                <div className="absolute w-[21px] h-[59px] top-0 left-[324px]">
                    <div className="relative w-[19px] h-[59px] bg-[#ff914d] rounded-[1.13px_8.48px_9.61px_9.61px]">
                        <div className="absolute h-2.5 top-[25px] -left-3 rotate-[90.00deg] [font-family:'Mulish',Helvetica] font-bold text-white text-[7px] tracking-[0] leading-[9.0px] whitespace-nowrap">
                            Active Listing
                        </div>
                    </div>
                </div>
                <div className="absolute w-9 h-[7px] top-[169px] left-[92px] bg-[#2a2a3399] rounded-[564.96px]">
                    <div className="inline-flex items-center gap-[1.7px] relative top-px left-0.5">
                    <div className="relative w-[10.75px] h-[4.52px] bg-white rounded-[2.26px]" />
                    <div className="relative w-[3.39px] h-[3.39px] bg-white rounded-[1.7px] opacity-60" />
                    <div className="relative w-[3.39px] h-[3.39px] bg-white rounded-[1.7px] opacity-60" />
                    <div className="relative w-[3.39px] h-[3.39px] bg-white rounded-[1.7px] opacity-60" />
                    <div className="relative w-[3.39px] h-[3.39px] bg-white rounded-[1.7px] opacity-60" />
                    </div>
                </div>

                {/* check button */}
                <div className="absolute w-[26px] h-[26px] top-[7px] left-[3px] bg-white rounded-[3px] border border-solid border-[#00000042] shadow-[0px_2.62px_13.1px_#0000001f]">
                    <img
                    className="h-[9px] top-2 left-[7px] absolute w-[11px]"
                    alt="Vector"
                    src={checkButton}
                    />
                </div>
                {/* like button */}
                {/* <img
                    className="absolute w-[22px] h-[19px] top-[22px] left-[970px]"
                    alt="Icon"
                    src={icon3}
                /> */}

                {/* card values */}
                <CardValues />

                <img
                    className="absolute w-[15px] h-[13px] top-16 left-[843px]"
                    alt="Polygon"
                    src={polygon3}
                />
            </div>
        </div>
    );
}

function CardValues({
    propertyName='Property name', 
    address='3806 W 20th Ave, Kennewick, WA 99338',
    amenities='Amenities - View, Balcony, Garage, Dishwasher, Fitness Center',
    suggestedRentValue=1234,
    rent=123,
    floorNumber=10,
    stories=6,
    avgUnitSize='741 SF',
    views=20,
    showings=20,
    date='12.12.2024',
    parking='-',
    type='Apartments - All',
    distance='-'
}) {
    const segmentsData = [
        { val: `$1,075`, label: 'Rent/SqFt' },
        { val: rent, label: 'Rent' },
        { val: floorNumber, label: 'Floor Number' },
        { val: stories, label: 'Stories' },
        { val: avgUnitSize, label: 'Avg. Unit Size' },
        { val: views, label: 'No. Viewed' },
        { val: showings, label: 'No. Showings' },
        { val: date, label: 'Lease Expiry' },
        { val: parking, label: 'Parking' },
        { val: type, label: 'Type' },
        { val: distance, label: 'Distance to Transit' }
    ];
    return (
        <div className="absolute w-[464px] h-[157px] top-[23px] left-[372px]">
                    <p className="absolute h-3.5 top-[25px] left-0 [font-family:'Poppins',Helvetica] font-normal text-[#2a2a33] text-xs tracking-[0] leading-[13.6px] whitespace-nowrap">
                    {amenities}
                    </p>
                    <p className="absolute h-3.5 top-0 left-0 [font-family:'Poppins',Helvetica] font-normal text-black text-xl tracking-[0] leading-[13.6px] whitespace-nowrap">
                    <span className="font-bold">{propertyName}</span>
                    <span className="font-semibold text-sm"> {address}</span>
                    </p>
                    <div className="absolute w-[460px] h-24 top-[61px] left-0">

                    {/* card values  */}



        <div className="relative w-[460px] h-24 flex flex-wrap items-start gap-[21px_13px]">
            {segmentsData.map(({ val, label }, idx) => (
                <React.Fragment key={idx}>
                    <Segments v1={val} v2={label} />
                    {idx < segmentsData.length - 1 && <img className="relative w-px h-[30px]" alt="Line" src="/img/line-7.svg" />}
                </React.Fragment>
            ))}
        </div>

                    </div>
                </div>
    );
}

